import './App.scss';

import React from 'react';
import Slideshow from './components/Slideshow';
import MusicComponent from './components/MusicComponent';

function App() {
  return (
    <div className="App">
      <Slideshow/>
      <MusicComponent/>
    </div>
  );
}

export default App;
